PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "conversions" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "measure_a_id" integer, "measure_b_id" integer, "created_at" datetime, "updated_at" datetime, "quantity" decimal(8,2));
CREATE TABLE "invoices" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "number" varchar(255), "invoice_date" date, "vendor_id" integer, "created_at" datetime, "updated_at" datetime, "total" decimal);
CREATE TABLE "measures" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "abbreviation" varchar(255), "created_at" datetime, "updated_at" datetime, "measure_type" boolean, "volume_weight" integer, "english_metric" integer, "custom" integer);
CREATE TABLE "menu_items" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "title" varchar(255), "price" decimal, "margin" decimal, "created_at" datetime, "updated_at" datetime, "recipe_id" integer);
CREATE TABLE "recipe_ingredients" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "recipe_id" integer, "menu_item_id" integer, "created_at" datetime, "updated_at" datetime, "cost" decimal, "total_cost" decimal, "quantity" decimal, "ingredient_id" integer, "measure_id" integer);
CREATE TABLE "vendors" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "address_1" varchar(255), "address_2" varchar(255), "address_city" varchar(255), "address_state" varchar(255), "address_postal_code" varchar(255), "created_at" datetime, "updated_at" datetime);
CREATE TABLE "schema_migrations" ("version" varchar(255) NOT NULL);
CREATE TABLE "invoice_ingredients" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "invoice_id" integer, "ingredient_id" integer, "measure_id" integer, "qty_ordered" decimal, "price" decimal, "extended" decimal, "created_at" datetime, "updated_at" datetime, "qty_shipped" decimal, "brand" varchar(255), "item_number" varchar(255), "vendor_number" varchar(255), "description" text, "unit" varchar(255), "pack" decimal, "pack_qty" decimal, "pack_size" decimal);
CREATE TABLE "categories" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "description" varchar(255), "created_at" datetime, "updated_at" datetime, "parent_id" integer, "custom" integer);
CREATE TABLE "ingredients" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "category_id" integer, "last_price" decimal, "created_at" datetime, "updated_at" datetime, "parent_id" integer, "custom" integer);
CREATE TABLE "recipes" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "title" varchar(255), "cost" decimal, "created_at" datetime, "updated_at" datetime, "parent_id" integer);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
COMMIT;
